pragma solidity >=0.4.21 <0.6.0;


contract Result{
    string public dapp_name = "Result-Dapp"; // dapp name
    // incremental
    uint public result_count = 0; // default value for result count
    mapping(uint => Result) public results;


    struct Result {
        uint id;
        string first_name;
        string last_name;
        string mat_no;
        string department;
        string course_name;
        string credit_unit;
        bool isComplete;
   }

   event ResultCreated(
        uint id,
        string first_name,
        string last_name,
        string mat_no,
        string department,
        string course_name,
        string credit_unit,
        bool isComplete
   );

  // crete result
  function createResult(
            string memory _first_name,
            string memory _last_name,
            string memory _mat_no,
            string memory _department,
            string memory _course_name,
            string memory _credit_unit
            ) public{
    result_count++;
    results[result_count] = Result(
                                result_count,
                                _first_name,
                                _last_name,
                                _mat_no,
                                _department,
                                _course_name,
                                _credit_unit,
                                false
                            );
    emit ResultCreated(
            result_count,
            _first_name,
            _last_name,
            _mat_no,
            _department,
            _course_name,
            _credit_unit,
            false
    );

  }
}
